import React, { Component } from 'react';
import './App.css';
import Header from './Header';
import Filters from './Filters';
import Products from "./Products";

class App extends Component {
  constructor(){
    super(); 
    this.state = {
      products: Products
    }
  }
  render() {
    return (
      <div className="App">
       <Header />
       <div className="wrapper">
         <div className="filtersLinks">

         </div>
         <Filters />
       </div>
      </div>
    );
  }
}

export default App;
